import React from 'react';
import './Button.scss';

export const BUTTON_STYLES = {
    DEFAULT : 'button-default',
    GREEN :'button-green'
}

export const BUTTON_SIZES = {
    SMALL : 'button-small',
    MEDIUM :'button-medium',
    BIG : 'button-big'
}

const Button = props => (
    <div className='button'>
        {props.text}
    </div>
)

export default Button
